import React from "react";
import { useParams } from "react-router-dom";
import image1 from "../assets/Google_cybersecurity_theme.jpeg";

const courseData = {
  "google-cybersecurity": {
    title: "Google Cybersecurity Professional Certificate",
    description:
      "Get on the fast track to a career in cybersecurity. In this certificate program, you'll learn in-demand skills, and get AI training from Google experts. Learn at your own pace, no degree or experience required.",
    image: image1,
    instructor: "Google Career Certificates",
    startDate: "Starts Apr 11",
    enrolled: "899,763 already enrolled",
    stats: {
      courses: "8 course series",
      rating: "4.8 ★ (41,905 reviews)",
      level: "Beginner level",
      duration: "6 months",
      schedule: "Flexible schedule",
    },
    about: [
      "Understand the importance of cybersecurity practices and their impact for organizations.",
      "Protect networks, devices, people, and data from unauthorized access and cyberattacks using Security Information and Event Management (SIEM) tools.",
      "Identify common risks, threats, and vulnerabilities, as well as techniques to mitigate them.",
      "Gain hands-on experience with Python, Linux, and SQL.",
    ],
    skills: ["Network Security", "Python Programming", "Cloud Computing"],
    outcomes: "Prepare for entry-level cybersecurity jobs like security analyst or SOC analyst.",
    courseStructure:
      "Includes 8 courses: intro to cybersecurity, incident response, threat mitigation, and hands-on labs.",
    testimonials: [
      "This program helped me land my first cybersecurity job!",
      "The hands-on labs and instructors were fantastic!",
    ],
  },
};

const CourseDetail = () => {
  const { slug } = useParams();
  const course = courseData[slug];

  if (!course) return <div className="p-6">❌ Course not found</div>;

  return (
    <div className="bg-[#f8f9fa] text-black">
      {/* Hero Section */}
      <div className="bg-[#e8f0fe] px-6 py-10">
        <h1 className="text-4xl font-bold mb-2">{course.title}</h1>
        <p className="max-w-3xl text-gray-800">{course.description}</p>

        <div className="mt-4 flex items-center gap-2">
          <span className="font-medium">Instructor:</span>
          <span className="text-blue-600 underline">{course.instructor}</span>
        </div>

        <div className="mt-4 flex flex-wrap items-center gap-6">
          <button className="bg-blue-600 text-white px-6 py-2 rounded-md hover:bg-blue-700 font-semibold">
            Enroll
            <div className="text-xs font-normal">{course.startDate}</div>
          </button>
          <p className="text-sm text-gray-800">{course.enrolled}</p>
        </div>
      </div>

      {/* Course Stats */}
      <div className="grid grid-cols-2 sm:grid-cols-4 text-center bg-white px-6 py-6 border-t border-gray-200 shadow-sm">
        <div>
          <p className="font-bold text-blue-900">{course.stats.courses}</p>
          <p className="text-xs text-gray-600">Earn a credential</p>
        </div>
        <div>
          <p className="font-bold text-blue-900">{course.stats.rating}</p>
          <p className="text-xs text-gray-600">Course rating</p>
        </div>
        <div>
          <p className="font-bold text-blue-900">{course.stats.level}</p>
          <p className="text-xs text-gray-600">No experience required</p>
        </div>
        <div>
          <p className="font-bold text-blue-900">{course.stats.duration}</p>
          <p className="text-xs text-gray-600">{course.stats.schedule}</p>
        </div>
      </div>

      {/* Tab Section */}
      <div className="px-6 py-8 max-w-5xl mx-auto">
        <CourseTabs course={course} />
      </div>

      {/* Skills Section */}
      <div className="px-6 pb-10 max-w-5xl mx-auto">
        <h3 className="font-semibold text-lg mb-2">Skills you'll gain</h3>
        <div className="flex flex-wrap gap-2">
          {course.skills.map((skill, idx) => (
            <span
              key={idx}
              className="bg-gray-200 text-gray-700 px-3 py-1 rounded-full text-sm"
            >
              {skill}
            </span>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CourseDetail;
